import './Navbar.css';

const Navbar = () => {
    return (  
<nav>
<label class="logo">SmeWeb1</label>
<ul class="ul-one">
	<li><a href="#">Home</a></li>
	<li><a href="#">about</a></li>
	<li><a href="#">misson</a></li>
	<li><a href="#">vision</a></li>
</ul>

	<div class="hamburger">
<div class="bar 1"></div>
<div class="bar 2"></div>
<div class="bar 3"></div>
</div>
</nav>
    );
}
 
export default Navbar;
